variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"281686","type":"CustomJS"},{"attributes":{},"id":"281404","type":"UnionRenderers"},{"attributes":{"coordinates":null,"data_source":{"id":"281335"},"glyph":{"id":"281522"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"281524"},"nonselection_glyph":{"id":"281523"},"view":{"id":"281526"}},"id":"281525","type":"GlyphRenderer"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"281585","type":"Segment"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"red"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"red"},"line_alpha":{"value":0.2},"line_color":{"value":"red"},"size":{"value":8},"x":{"value":1247},"y":{"value":0.10575709608399622}},"id":"281439","type":"Scatter"},{"attributes":{},"id":"281620","type":"AllLabels"},{"attributes":{"active_drag":{"id":"281358"},"active_scroll":{"id":"281359"},"tools":[{"id":"281358"},{"id":"281359"},{"id":"281360"},{"id":"281361"},{"id":"281362"},{"id":"281363"},{"id":"281364"},{"id":"281387"},{"id":"281687"}]},"id":"281366","type":"Toolbar"},{"attributes":{"axis":{"id":"281638"},"coordinates":null,"group":null,"ticker":null},"id":"281641","type":"Grid"},{"attributes":{},"id":"281548","type":"BasicTicker"},{"attributes":{"coordinates":null,"data_source":{"id"
